int convert_key_value_to_key_digit(int k_value) {
	if (k_value == 0x16) {
		return (1);
	}
	if (k_value == 0x1E) {
		return (2);
	}
	if (k_value == 0x26) {
		return (3);
	}
	if (k_value == 0x25) {
		return (4);
	}
	else {
		return (0);
	}

}

